●《新概念英语》【一册初级】："First Things First" 英语初阶 从基本的发音、重音和语调开始，让您逐步学会使用英语中的基本词汇、语法及句型结构。学好第一册，是练好英语基本功的关键，掌握了第一册，才算真正踏进了英语之门。
●《新概念英语》【二册基础】："Practice and Progress" 实践与进步在第一册全面技能训练的基础上，由浅入深，进一步在语法、口语、阅读、写作技能方面进行大信息量的全面培训，通过对关键句型的分析、词汇基本用法的讲解、摘要写作及作文练习中的串联造句、书信格式与题材的逐步介绍，将使学习者真正能用听、说、读、写来实践英语。是想要重新系统学习英语的学员的最佳选择！
●《新概念英语》【三册中级】："Developing Skills" 培养技能着重分析句子之间内在的逻辑关系，让学员充分认识和领悟英文句型的精练、优美、实用和可模仿性，从而将其有机地运用到英文写作之中；同时，将进一步扩充讲解词汇、语法及句型的实战运用。新三的目标就是要让学员教会用英语！
●《新概念英语》【四册高级】："Fluency in English" 流利英语全册涵盖了文学、经济、体育、政治、等三十多个学科门类，语言修辞精美独到，句型结构复杂多变，内容精练，同时，许多文章蕴涵着深厚的哲思、美学及西方文化中独特的思维方式，从而使该教材成为每一位欲掌握英语语言精华的学习者不可多得、不可不学的读物，理解了第四册，便理解了英语文化，便学会了英语思维。
